import React from "react";
import ReactDom from "react-dom";
import "./style.css";

function App() {
	return (
		<h1 style={{ textAlign: "center" }}>Hello world</h1>,
		<button name="button1" ></button>
	);
}

ReactDom.render(<App />, document.getElementById("root"));
